import React, { Fragment } from 'react'

const Team = () => {
  return (<Fragment>
    <div className=" h-pr-fl-ma centered bg-orange" Style="width: 500px; height: 500px;"><div className=" p-a " Style="background: red; width: 100px; height: 100px; top: 0px; bottom: 0px; margin: auto; left: -150px; right: 0px;">asd</div>
    <div className="w-125px h-125px p-a of-h  m-a circle b-s-b-b" Style="left: 0px; top: 0px; right: 0px; bottom: 0px; margin:auto; border: 1px solid; border-color: white;">
      <div className="w-100 h-100 h-pr-fl-ma bg-red b-s-b-b centered"><span className="w-a h-a h-pr-fl-ma centered ">LOGO</span></div></div>
    </div></Fragment>
  )
}

export default Team
